import React, { useState } from 'react';
import {Link} from 'react-router-dom'


const QuestionOne = () => {
  let [dogState,setDogState]=useState("Dog");
  return (
    <div>
      <div className='backImage'>
     <img className='ImgStyle' src="https://images.pexels.com/photos/247502/pexels-photo-247502.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" alt="" />
     <h4>Choose the correct answer </h4>
      <div className='btn-fild'>
          <button className="btn btn-secondary">Squirrel. </button>
          <button className="btn btn-secondary"> Dp  </button>
          <button className="btn btn-secondary">Chimpanzee </button>
        <Link to='/questiotwo'><button className="btn btn-secondary"> {dogState} </button></Link>  

      </div>
      </div>


    </div>
  )
}

export default QuestionOne
